        final List<KeyValue<byte[], byte[]>> checkpoint = new ArrayList<>();
        checkpoint.add(new KeyValue<>("1".getBytes("UTF-8"), "a".getBytes("UTF-8")));
        checkpoint.add(new KeyValue<>("2".getBytes("UTF-8"), "b".getBytes("UTF-8")));
